import styled from 'styled-components';

const Root = styled.div`
  position: fixed;
  left: 30px;
  bottom: 30px;
`;

const Label = styled.div`
  background: red;
  color: #fff;
  font-weight: bold;
  box-shadow: 0 1px 4px rgba(0, 0, 0, 0.5);
  padding: 10px;
`;

export { Root, Label };
